【アヴァンセ ラッシュセラムインマスカラ ボリュームインパクト グロッシーブラックの詳細】<br>
●まつ毛美容液“ラッシュセラムシリーズ”と同じ「美容液成分（保湿成分）」を高配合！メイク中もとことんまつ毛ケア！<br>
●お湯で簡単に洗い落とせます。汗・涙に強いフィルムタイプです。<br>
●ボリュームアップファイバー配合。<br><br>

【使用方法】<br>
1.ブラシをまつ毛の根元にあて、持ち上げるように数秒間固定してからまつ毛先端に向けて左右小刻みに動かしながら液を絡ませます。<br>
2.さらにボリュームを出したいときは、マスカラ液が半渇きの状態でブラシできれいにとかすように全体に重ね塗りします。<br><br>

【成分】<br>
水、(アクリレーツ/アクリル酸エチルヘキシル)コポリマー、ミツロウ、BG、酸化鉄、カルナウバロウ、ステアリン酸、(HDI/トリメチロールヘキシルラクトン)クロスポリマー、TEA、PVP、カーボンブラック、クオタニウム-51、パンテニルエチル、アカツメクサ花エキス、アセチルテトラペプチド-3、ビオチノイルトリペプチド-1、パンテノール、トコフェロール、エチルヘキシルグリセリン、グリセリン、シリカ、ステアリン酸ソルビタン、デキストリン、パルミチン酸、ヒドロキシエチルセルロース、PEG-40水添ヒマシ油、PET、ポリソルベート60、ミリスチン酸、ラウレス-21、フェノキシエタノール、メチルパラベン<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
アヴァンセ株式会社<br>
京都港区六本木6-4-1ハリウッドビューティプラザ4F<br>
お問い合わせ先：03-3403-3817<br><br>

【商品区分】<br>
化粧品<br><br>

[AVANCE/ケアマスカラ]

