●毛髪保護成分：ヒアルロン酸Na・加水分解シルク・オタネニンジン根エキス・ユズ果実エキス・ローズマリーエキス・ヒドロキシプロピルキトサン<br>
●グロッシーワックス（キャンデリラロウ・マイクロクリスタリンワックス）が艶感の高い皮膜を形成。カーボンブラックを含んだ黒色原料を均一に分散させることで、深みのある漆黒に。<br><br>

【使用方法】<br>
●ブラシをまつ毛の根元にあて、持ち上げるように数秒間固定してからまつ毛先端に向けて左右小刻みに動かしながら液を絡ませます。<br>
●さらにボリュームを出したいときは、マスカラ液が半乾きの状態でブラシでキレイにとかすように全体に重ね塗りします。<br>
●落とすときは、38度以上のお湯で十分にふやかした後、指でやさしくつまむようにそっと落としてください。ヤケドにご注意ください。<br><br>

【使用上の注意】<br>
○ご使用後はキャップをきちんとしめてください。<br>
○目に入ったときはすぐに水かぬるま湯で洗い流してください。<br>
○水や化粧水その他でうすめないでください。<br>
○傷やはれ物、湿疹等、お肌に異常のあるときは、お使いにならないでください。<br>
○使用中、赤味、はれ、かゆみ、刺激等の異常があらわれた場合は使用を中止し、皮膚科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>
○極端に高温、低温となる場所、直射日光のあたる場所には置かないでください。<br>
○乳幼児の手の届かないところに保管してください。<br>
○ボトルからブラシを取り出す際には、液が垂れ落ちないように十分ご注意ください。<br><br>

【配合成分】<br>
水、アクリル酸アルキルコポリマーアンモニウム、ミツロウ、ステアリン酸、カルナウバロウ、TEA、キャンデリラロウ、BG、アラビアゴム、セタノール、マイクロクリスタリンワックス、ポリ酢酸ビニル、クオタニウム-51、パンテニルエチル、ヒアルロン酸Na、加水分解シルク、オタネニンジン根エキス、ユズ果実エキス、ローズマリーエキス、ヒドロキシプロピルキトサン、トコフェロール、EDTA-2Na、エタノール、ジメチコン、コメヌカロウ、DPG、パラフィン、ヒドロキシプロピルセルロース、ポリビニルアルコール、フェノキシエタノール、プロピルパラベン、メチルパラベン、酸化鉄、カーボンブラック<br><br>

【販売元】<br>
アヴァンセ株式会社<br>
お問合わせ先：03-3403-3817<br><br>

【商品区分】<br>
